import React from "react";
import Card from './Card.js';

const CardList = ({ robots }) => {
    return (
        <div>
            {robots.forEach(robot => {
                return <Card id={robot.id} name={robot.name} email={robot.email}/>})}
        </div>
    )
}

export default CardList
